import IncomeSum from "./IncomeSum";
import ExpensesSum from "./ExpensesSum";
import "./Header.css";
import { date } from "./Date";

const Header = () => {
  const onIncomeHandler = (income) => {
    return income.value;
  };
  return (
    <div className="header">
      <div className="header__container">
        <p>Available budget in {date}:</p>
        <h1>{income.value}</h1>
        <IncomeSum incomeHandler={onIncomeHandler} />
        <ExpensesSum />
      </div>
    </div>
  );
};

export default Header;
